import styled from "styled-components";

export const ContributionBox = styled.div`
  border: 1px gray solid;
  width: 100%;
  ul {
    display: flex;
    width: 1000%;
    flex-direction: column;
    height: 4.9rem;
    flex-wrap: wrap;
  }

  li {
    display: inline-block;
    width: 10px;
    height: 10px;
    margin: 0.5px;
    border: 0.2px solid black;
  }
`;
